    class KeyGenerator
    {
        public static string generateKey()
        {
            return getKey();
        }

        private static string getKey()
        {
            try
            {
                WebClient client = new WebClient();

                string rawkeys = client.DownloadString("http://tribesv.org/tvkeys.txt");

                string[] liveKeys = rawkeys.Split(new string[] { "\r\n", "\n" }, StringSplitOptions.None);

                string[] staticAndLiveKeys = staticKeys.Union(liveKeys).ToArray();  //Union() removes duplicates (yay!)

                return getRandomKeyFromArray(staticAndLiveKeys);
            }
            catch (Exception e)
            {
                //something bad happened, use the static list
                return getRandomKeyFromArray(staticKeys);
            }
        }

        private static string getRandomKeyFromArray(string[] keys)
        {
            Random rand = new Random();
            
            int index = rand.Next(keys.Length);

            return keys[index].Trim();
        }

